import React from "react";
import happy from "../assets/happy.png";
import sad from "../assets/sad.png";
import neutral from "../assets/neutral.png";

export default function EntryList({ entries }) {
  const getImage = (emotion) => {
    if (emotion === "Happy") return happy;
    if (emotion === "Sad") return sad;
    return neutral;
  };

  return (
    <div className="w-full max-w-2xl bg-white/80 backdrop-blur-lg rounded-2xl shadow-lg p-6 border border-pink-100 card-glow">
      <h2 className="text-xl font-semibold mb-4 text-pink-600 flex items-center gap-2">
        üìù Journal Entries
      </h2>
      {entries.length === 0 ? (
        <p className="text-gray-500">No entries yet. Start journaling today! üí¨</p>
      ) : (
        <ul className="space-y-4">
          {entries.map((e, i) => (
            <li
              key={i}
              className="p-4 bg-white/90 rounded-xl shadow hover:shadow-md flex justify-between items-center"
            >
              <div>
                <p className="text-gray-700">{e.text}</p>
                <p className="text-sm text-gray-500">{e.date}</p>
              </div>
              <div className="flex flex-col items-center">
                <img src={getImage(e.emotion)} alt={e.emotion} className="w-10 h-10" />
                <span
                  className={`text-sm font-medium ${
                    e.emotion === "Happy"
                      ? "text-green-500"
                      : e.emotion === "Sad"
                      ? "text-red-500"
                      : "text-gray-500"
                  }`}
                >
                  {e.emotion}
                </span>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
